import React from 'react';

class Applicantconnection extends React.Component{
    componentDidMount(){
        const apiUrl='http://127.0.0.1:8000/job/Applicant/';
        fetch(apiUrl)
         .then((response)=> response.json())
         .then((data)=> console.log(data))
    }
    render(){
        return <div>Applicant connection</div>
    }

}

export default Applicantconnection;
